`timescale 1 ns/ 1 ns
module nms_decode_tb();

reg  clk;
reg rst_n;
reg enable;
reg [8175:0]buffer;
reg [8175:0]right;
reg [8175:0] out;

wire nms_finish;
wire [8175:0]buffer_2;


nms_decode i1 (
	.clk(clk),
	.rst_n(rst_n),
	.enable(enable),
	.buffer(buffer),
	.nms_finish(nms_finish),
	.buffer_3(buffer_2)
);


initial                                                
    begin                                                  
        rst_n = 1'b0;
        clk = 1'b1;
        enable = 1'b0; 
        #21 rst_n = 1'b1; 
        #100 enable = 1'b1;
		#20 enable = 1'b0;                 
        $display("Running testbench");                       
    end     

initial                                                
    begin                                                
       buffer = 8176';
    end

initial                                                
    begin                                                  
        right = 8176'; 
    end



always                                                                 
    begin                                                                    
        #10 clk = ~clk;
		out = buffer_2 ^ right;                                                                                                                                               
    end                                                    
endmodule